import React, { Component } from 'react';
import { Row, Col, Card, CardHeader, CardFooter, Button, CardBody,Form,FormGroup, Label, Input, FormText, InputGroup, InputGroupAddon, InputGroupText } from 'reactstrap';
import { Formik } from 'formik';
// React select
import states from '../Forms/AdvancedForms/data/states';
import Select from 'react-select';
import 'react-select/dist/react-select.min.css';

const options = states.US;

const initialValues = {
  firstName: "",
  lastName: "",
  userName: "",
  email: "",
  password: "",
  confirmPassword: "",
  accept: false
}

class AddHealthArea extends Component {
  constructor(props) {
    super(props);
    this.saveRealmChanges = this.saveRealmChanges.bind(this);
    this.saveCountryChanges = this.saveCountryChanges.bind(this);
    this.state = {
      value1: [],
      value2: []
    };
  }

  saveRealmChanges(value1) {
    this.setState({ value1 });
  }

  saveCountryChanges(value2) {
    this.setState({ value2 });
  }

  render() {

    return (
      <div className="animated fadeIn">
        <Row>
          <Col sm={12} md={6} style={{ flexBasis: 'auto' }}>
            <Card>
              <CardHeader>
                <i className="icon-note"></i><strong>Add Health Area</strong>{' '}
              </CardHeader>
              <CardBody>
              <Formik
              initialValues={initialValues}
              validate={validate(validationSchema)}
              onSubmit={onSubmit}
              render={
                ({
                  values,
                  errors,
                  touched,
                  status,
                  dirty,
                  handleChange,
                  handleBlur,
                  handleSubmit,
                  isSubmitting,
                  isValid,
                  handleReset,
                  setTouched
                }) => (
                <Form onSubmit={handleSubmit} noValidate name='simpleForm'>
                  <FormGroup>
                    <Label>Realm</Label>
                    <Select
                      name="realmId"
                      value={this.state.value1}
                      options={options}
                      onChange={this.saveRealmChanges}

                    />
                  </FormGroup>
                  <FormGroup>
                    <Label>Country</Label>
                    <Select
                      name="countryId"
                      value={this.state.value2}
                      options={options}
                      onChange={this.saveCountryChanges}
                      multi
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="healthArea">Health Area</Label>
                    <Input type="text"
                      name="healthAreaName"
                      id="healthAreaName"
                      required />
                  </FormGroup>
                  <FormGroup>
                          {/* <Button type="submit" color="primary" className="mr-1" disabled={isSubmitting || !isValid}>{isSubmitting ? 'Wait...' : 'Submit'}</Button> */}
                          {/* <Button type="button" color="success" className="mr-1" onClick={() => this.touchAll(setTouched, errors)}  disabled={isValid}>Validate</Button> */}
                          {/* <Button type="reset" color="danger" className="mr-1" onClick={handleReset}>Cancel</Button> */}
                        </FormGroup>
                </Form>
                  )} />
              </CardBody>
              <CardFooter>
                <Button type="submit" size="md" color="primary"><i className="fa fa-dot-circle-o"></i> Submit</Button>
                <Button type="reset" size="md" color="danger"><i className="fa fa-ban"></i> Cancel</Button>
              </CardFooter>
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}

export default AddHealthArea;
